import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('https://riktam.tigersheet.com/api/sheet-api/get-records?sheet_id=78425244', {
          headers: {
            'Content-Type': 'application/json',
            'Authorization': 'Bearer C9B53439FA03FB946C93E9AC9963070B221EC0E3CD66399A',
          },
        });

        setData(response.data.data);
        console.log(response)
      } catch (error) {
        console.error('Error fetching data:', error.message);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Tigersheet API Example</h1>
      <ul>
        {data.map(item => (
          <li key={item.record_id}>
            <p>Username: {item.username}</p>
            <p>Password: {item.password}</p>
            <p>Email: {item.email}</p>
            <p>Created At: {item.created_at}</p>
            <p>Updated At: {item.updated_at}</p>
            <p>Comments Count: {item.comments_count}</p>
            <hr />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default App;
